&lt;p&gt;
	I agree with the inspection results but have since carried out the following improvements:the establishment has been thoroughly cleaned and procedures are in place to ensure that cleanliness is maintained; a new management system has been implemented and staff have been trained/retrained.&lt;/p&gt;
&lt;p&gt;
